from collections import defaultdict

def find_eulerian_path(graph):
    start = None
    for node, neighbors in graph.items():
        if len(neighbors) % 2 == 1:
            if start is None:
                start = node
            else:
                return None
    if start is None:
        start = next(iter(graph))

    stack = [start]
    path = []

    while stack:
        current = stack[-1]
        if graph[current]:
            next_node = graph[current].pop()
            stack.append(next_node)
        else:
            path.append(stack.pop())

    if len(path) == sum(len(neighbors) for neighbors in graph.values()) + 1:
        return path[::-1]
    else:
        return None

